  static List<ContentRating> listFromJson(dynamic json, {bool growable = false,}) {
    final result = <ContentRating>[];
    if (json is List && json.isNotEmpty) {
      for (final row in json) {
        final value = ContentRating.fromJson(row);
        if (value != null) {
          result.add(value);
        }
      }
    }
    return result.toList(growable: growable);
  }

  static Map<String, ContentRating> mapFromJson(dynamic json) {
    final map = <String, ContentRating>{};
    if (json is Map && json.isNotEmpty) {
      json = json.cast<String, dynamic>(); // ignore: parameter_assignments
      for (final entry in json.entries) {
        final value = ContentRating.fromJson(entry.value);
        if (value != null) {
          map[entry.key] = value;
        }
      }
    }
    return map;
  }

  // maps a json object with a list of ContentRating-objects as value to a dart map
  static Map<String, List<ContentRating>> mapListFromJson(dynamic json, {bool growable = false,}) {
    final map = <String, List<ContentRating>>{};
    if (json is Map && json.isNotEmpty) {
      // ignore: parameter_assignments
      json = json.cast<String, dynamic>();
      for (final entry in json.entries) {
        map[entry.key] = ContentRating.listFromJson(entry.value, growable: growable,);
      }
    }
    return map;
  }

